import { Button} from 'react-bootstrap';
import './Home.css';

const Home = () => {

    return (
        <div>
            <section>
                <div className="pb-5">
                    <div className="col-md-12 top-banner">
                        <div className="container">
                            <h1 className="org-title">FEDERAL HEALTH CARE</h1>
                            <p className="org-motto">Better Care and Better Understanding.</p>
                        </div>
                    </div>
                </div>    
            </section>
        </div>
    );
};

export default Home;
